var cardNumber = Get<string>("CardNumber");
var contactId = Get<Guid>("ContactId");
bool updateContactSuccess;
bool InsertTransactionsSuccess;
SearchResponse search  = new SearchResponse();
UsrProcessingIntegration item = new UsrProcessingIntegration();
AuthorizationResponse authResponse = item.Authorization();
if(authResponse!=null)
{
	search = item.Search(cardNumber, authResponse.sid, 1);
}
else
{
	item.AuthorizationFailed();
	throw new Exception("Ошибка авторизации к серверу процессинга!");
}
if(search!=null)
{
	item.UpdateContact(search.uid, contactId, authResponse.sid);
}
else
{
	item.ContactNotFoundOnServer();
}
return true;

